edit functions/calculateTransportEmissions.m

%[text] READ the function signature carefully. You'll complete 1 section:
%[text] 1. Input validation \
%[text] Then ask Copilot to explain the code that calculates daily commute emissions.
%[text] You can use the hints provided to prompt MATLAB Copilot so it supports your tasks. Remember to double check. 
%[text] If you want to check the solution, check the file "`solutions/calculateTransportEmissions_complete.m`"
%%
%[text] ### **Step 4: Test Your Function Manually**
%[text] Once you've completed the function, test it with realistic scenarios

% SCENARIO 1: US suburban commuter
annualCO2_US = calculateTransportEmissions( ...
    'USA', ...
    'Car_Gasoline', ...  % Daily commute mode
    25, ...              % Daily commute distance (km)
    250, ...             % Commute days per year
    2, ...               % Domestic flights per year
    1500, ...            % Avg domestic flight distance (km)
    1, ...               % International flights per year  
    8000, ...            % International flight distance (km)
    50);                 % Other travel per week (km)

fprintf('\n=== SCENARIO 1: US Suburban Commuter ===\n'); %[output:7f32d62d]
fprintf('Annual transport emissions: %.1f kg CO₂e\n', annualCO2_US); %[output:681b5a1c]
fprintf('Equivalent to: %.2f tons CO₂e\n', annualCO2_US/1000); %[output:63fbded5]

% SCENARIO 2: European train commuter
annualCO2_EU = calculateTransportEmissions(...
    'Europe', ...
    'Train_Rail', ...    % Takes train to work!
    35, ...
    240, ...
    3, ...
    800, ...
    0, ...
    0, ...
    30);

fprintf('\n=== SCENARIO 2: European Train Commuter ===\n'); %[output:3e8b51d9]
fprintf('Annual transport emissions: %.1f kg CO₂e\n', annualCO2_EU); %[output:369abdbe]
fprintf('Equivalent to: %.2f tons CO₂e\n', annualCO2_EU/1000); %[output:41627748]
fprintf('Reduction vs US scenario: %.0f%%n', (1-annualCO2_EU/annualCO2_US)*100); %[output:2af9ebce]

% SCENARIO 3: Asian urban resident (transit + scooter)
annualCO2_Asia = calculateTransportEmissions(...
    'Asia', ...
    'Motorcycle', ...    % Scooter commute
    15, ...
    300, ...
    1, ...
    1200, ...
    0, ...
    0, ...
    20);

fprintf('\n=== SCENARIO 3: Asian Urban Resident ===\n'); %[output:5ff917e3]
fprintf('Annual transport emissions: %.1f kg CO₂e\n', annualCO2_Asia); %[output:26c45a20]
fprintf('Equivalent to: %.2f tons CO₂e\n', annualCO2_Asia/1000); %[output:08de87a3]

% Compare to benchmarks
fprintf('\n=== Global Context ===\n'); %[output:947c86c7]
fprintf('Global average transport emissions: ~1.2 tons CO₂/year per person\n'); %[output:017c0122]
fprintf('US average: ~4.8 tons CO₂/year\n'); %[output:64e0b4d2]
fprintf('EU average: ~2.1 tons CO₂/year\n'); %[output:1e19e555]
fprintf('Source: Our World in Data, Transport CO₂ per capita\n'); %[output:9ecb0665]

