%[text] ### **Step 5: Check Unit Tests**
%[text] Professional engineers test their code. Let's ensure your function works! Your tests should verify:
%[text] 1. Zero inputs lead to zero emissions
%[text] 2. Known calculation leads to a correct result
%[text] 3. Regional variation leads different results for same inputs
%[text] 4. Input validation leads to errors on negative/invalid inputs
%[text] 5. Boundary conditions handle extreme but valid values \
%[text] **Why test?**
%[text] This function will be used globally, with different:
%[text] - Regions (USA, Europe, Asia, Latin America)
%[text] - Transport modes (car, train, bus, motorcycle, flights)
%[text] - Input ranges (urban commuter vs. frequent flyer) \
%[text] **Tests ensure it works correctly for ALL scenarios, not just yours!**
%[text] 
%[text] Option 1: In your toolstrip look for "**Find Tests**"  and select the folder of the workshop. This will find the corresponding unit test for this specific function. 
%[text] 
%[text] Option 2: MATLAB R2025a introduced the Test Browser Panel:
%[text] 1. Look for "Test Browser" in the left sidebar (new in R2025a!)
%[text] 2. Click to open the panel
%[text] 3. Navigate to tests/TestTransportEmissions.m
%[text] 4. Click "Run" button
%[text] 5. Watch tests execute with visual feedback \
%%
%[text] ### **OPTIONAL: Calculate YOUR Annual Transport Footprint**

% TODO: Update these values with YOUR typical travel patterns
myRegion = 'USA';              % Change to your region
myCommuteMode = 'Car_Gasoline'; % Change to your mode
myDailyCommuteKm = 20;         % One-way distance
myCommuteDays = 250;           % Working days per year
myDomesticFlights = 2;         % Round trips
myDomesticFlightKm = 1500;     % Avg distance per flight
myIntlFlights = 0;             % Round trips
myIntlFlightKm = 0;            % Avg distance
myOtherTravelKm = 40;          % Weekend/errands per week

% Calculate
myAnnualEmissions = calculateTransportEmissions(...
    myRegion, myCommuteMode, myDailyCommuteKm, myCommuteDays, ...
    myDomesticFlights, myDomesticFlightKm, ...
    myIntlFlights, myIntlFlightKm, myOtherTravelKm);

fprintf('\n========================================\n'); %[output:82e8a676]
fprintf('YOUR ANNUAL TRANSPORT FOOTPRINT\n'); %[output:3e64d31e]
fprintf('========================================\n'); %[output:8b8d4b53]
fprintf('Total emissions: %.1f kg CO₂e (%.2f tons)\n', ... %[output:group:94428d6f] %[output:93d08ee1]
        myAnnualEmissions, myAnnualEmissions/1000); %[output:group:94428d6f] %[output:93d08ee1]

